import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS

export default function Dream() {
    return (
        <div className="container mt-5">
            <h1 className="mb-4">Dream Image Upload</h1>
            <p className="mb-4">Upload an image below to start your dream journey!</p>
            <div className="custom-file">
                <input type="file" className="custom-file-input" id="dreamImageInput" />
                <label className="custom-file-label" htmlFor="dreamImageInput">Choose image</label>
            </div>
        </div>
    );
}
